JavaScript之对象、原型链及继承
本章将学习：理解对象创建过程、原型链及继承
理解对象

ECMA-262将对象定义为一组属性的无序集合，每个属性或方法都有一个名称来表示，可将其想象为一张散列表，值可以为数据/函数


例1

// 使用 new Object() 进行创建
let person = new Object();
person.name = "cosine";
person.age = 29
person.job = "Software Engineer"; 
person.sayName = function() { 
 console.log(this.name); 
}; 
// 使用对象字面量创建
let person = {
  name: 'cosine',
  age: 29, 
  job: "Software Engineer", 
  sayName() { 
    console.log(this.name); 
  }
}

以上两种对象是等价的，其属性和方法都一样 可以思考一下： new 的过程中做了什么？ 后面也会提到
属性类型
ECMA-262 使用一些内部特性来描述属性的特征。这些特性是由为 JavaScript 实现引擎的规范定义的。因此，开发者不能在 JavaScript 中直接访问这些特性。为了将某个特性标识为内部特性，规范会用两个中括号把特性的名称括起来，比如[[Enumerable]] 属性分两种：数据属性和 访问器属性
数据属性
包含一个保存数据值的位置。值会从这个位置读取，也会写入到这个位置。数据属性有 4 个特性描述它们的行为

[[Configurable]] 可配置
表示属性是否可以通过 delete 删除并重新定义
是否可以修改它的特性
是否可以把它改为访问器属性
默认情况下，所有直接定义在对象上的属性的这个特性都是 true


[[Enumerable]] 可枚举
表示属性是否可以通过 for-in 循环返回
默认： true


[[Writable]] 可写
表示属性的值是否可以被修改
默认： true


[[Value]] 可写
包含属性实际的值
这就是前面提到的那个读取和写入属性值的位置
默认： undefined



在像前面例子中那样将属性显式添加到对象之后，[[Configurable]]、[[Enumerable]] 和 [[Writable]]都会被设置为 true，而 [[Value]] 特性会被设置为指定的值。
Object.defineProperty()方法
要修改属性的默认特性，就必须使用 Object.defineProperty()方法。这个方法接收 3 个参数：

obj 待添加属性的对象
prop 待定义或修改的属性名称或 Symbol
descriptor 要定义或修改的属性描述符

设置方法如下例
// Object.defineProperty()设置属性
let person = {};
Object.defineProperty(person, "name", {
  writable: false,    // 看这儿！ 不可修改
  value: "cosine"
});
console.log(person.name); // cosine
person.name = "NaHCOx";   // 试图修改 
console.log(person.name); // 修改无效 print: cosine

创建了一个名为 name 的属性并给它赋予了一个只读的值，则这个属性的值不能修改了

非严格模式下，尝试给这个属性重新赋值会被忽略。
严格模式下，尝试修改只读属性的值会抛出错误

类似的规则也适用于创建不可配置的属性 把 configurable 设置为 false，意味着这个属性不能从对象上删除。
注意：一个属性被定义为不可配置之后，就不能再变回可配置的了！！

再次调用 Object.defineProperty() 并修改任何非 writable 属性则会导致错误

在调用 Object.defineProperty()时，configurable、enumerable 和 writable 的值如果不指定，则都默认为 false。
访问器属性
访问器属性不包含数据值。相反，它们包含一个获取（getter）函数和一个设置（setter）函数，不过这两个函数不是必需的。

读取访问器属性时，会调用 getter 函数，返回一个有效的值
写入访问器属性时，会调用 setter 函数并传入新值，这个函数必须决定对数据做出什么修改

访问器属性有 4 个特性描述它们的行为:

[[Configurable]]：表示属性
是否可以通过 delete 删除并重新定义
是否可以修改它的特性
是否可以把它改为数据属性
默认：true


[[Enumerable]]：表示属性是否可以通过 for-in 循环返回。默认true
[[Get]]：获取函数，在读取属性时调用。默认值为 undefined
[[Set]]：设置函数，在写入属性时调用。默认值为 undefined

注意，上述属性的默认值都表示在直接定义对象上时的默认值，若用Object.defineProperty()，则没有定义的都为 undefined
下面是一个例子
// 访问器属性定义
// 定义一个对象，包含伪私有成员 year_和公共成员 edition 
let book = { 
  year_: 2017, 
  edition: 1 
};
Object.defineProperty(book, "year", {
  get() {
    return this.year_;
  },
  set(newVal) {
    if(newVal > 2017) {
      this.year_ = newVal;
      this.edition += newVal - 2017;
    }
  }
});
book.year = 1999
console.log(book.year);   // 2017
console.log(book.edition);  // 1
book.year = 2018
console.log(book.year);   // 2018
console.log(book.edition);  // 2

对象 book 有两个默认属性：year_和 edition year_中的下划线常用来表示该属性并不希望在对象方法的外部被访问 另一个属性 year 被定义为一个访问器属性，其中，

getter简单返回 year_的值
setter会做一些计算以决定正确的版本（edition）

因此，把 year 属性修改为 2018 会导致 year_变成 2018，edition 变成 2。而试图修改为1999则不会有变化，这是访问器属性的典型使用场景，即设置一个属性值会导致一些其他变化发生。
获取函数和设置函数不一定都要定义。

只定义getter 函数意味着属性是只读的，尝试修改属性会被忽略。在严格模式下，尝试写入只定义了获取函数的属性会抛出错误。
类似地，只有定义setter的属性是不能读取的，非严格模式下读取会返回 undefined，严格模式下会抛出错误。

其他定义属性函数
其他还可通过 Object.defineProperties() 定义多个属性，使用 Object.getOwnPropertyDescriptor()方法可以取得指定属性的属性描述符 ， Object.getOwnPropertyDescriptors() 方法可以取得每个自有属性的属性描述符并在一个新对象中返回。
合并对象
把源对象所有的属性一起复制到目标对象上，这种操作也被称为“混入”（mixin），因为目标对象通过混入源对象的属性从而得到了增强。 Object.assign() 方法用于将所有可枚举属性/自有属性的值从一个或多个源对象分配到目标对象，返回目标对象。
const target = { a: 1, b: 2 };
const source = { b: 4, c: 5 };

const returnedTarget = Object.assign(target, source);

console.log(target);
// expected output: Object { a: 1, b: 4, c: 5 }

console.log(returnedTarget);
// expected output: Object { a: 1, b: 4, c: 5 }

Object.assign() 实际上执行的是浅复制，只会复制对象的引用

若多个源对象都有相同的属性，则用最后一个复制的值。
从源对象访问器属性取得的值，比如获取函数，会作为一个静态值赋给目标对象。也就是说：不能在两个对象间转移获取函数和设置函数。
赋值期间出错，则操作会中止并退出，同时抛出错误。没有“回滚”之前赋值的概念，因此它是一个尽力而为、可能只会完成部分复制的方法。

对象标识及相等判定
ES6之前，有些情况利用===操作符进行判断是无法成功的，如
// 这些情况在不同 JavaScript 引擎中表现不同，但仍被认为相等
console.log(+0 === -0); // true 
console.log(+0 === 0); // true 
console.log(-0 === 0); // true 
// 要确定 NaN 的相等性，必须使用极为讨厌的 isNaN() 
console.log(NaN === NaN); // false 
console.log(isNaN(NaN)); // true

ES6规范改善了这类情况，新增了 Object.is() 方法用于判断两个值是否为同一个值
// 正确的 0、-0、+0 相等/不等判定
console.log(Object.is(+0, -0)); // false 
console.log(Object.is(+0, 0)); // true 
console.log(Object.is(-0, 0)); // false 
// 正确的 NaN 相等判定
console.log(Object.is(NaN, NaN)); // true

