ES6 语法糖
ECMAScript 6 为定义和操作对象新增了很多极其有用的语法糖特性。这些特性都没有改变现有引擎的行为，但极大地提升了处理对象的方便程度。
属性名简写
给对象添加变量的时候，经常会发现属性名和变量名是一样的。这个时候就可以使用变量名，不用再写冒号，如果没有找到同名变量，则会抛出 ReferenceError。 例如：
let name = 'cosine'; 
let person = { name: name }; 
console.log(person); // { name: 'cosine' }
// 使用语法糖 等价于上面那个
let person = { name }; 
console.log(person); // { name: 'cosine' }

代码压缩程序会在不同作用域间保留属性名，以防止找不到引用。
可计算属性
可在对象字面量中直接动态的命名属性：
const nameKey = 'name'; 
const ageKey = 'age'; 
const jobKey = 'job'; 
let uniqueToken = 0; 
function getUniqueKey(key) { 
 return `${key}_${uniqueToken++}`; 
} 
let person = { 
 [nameKey]: 'cosine', 
 [ageKey]: 21, 
 [jobKey]: 'Software engineer',
 // 也可以是表达式！
 [getUniqueKey(jobKey+ageKey)]: 'test'
}; 
console.log(person); 
// { name: 'cosine', age: 21, job: 'Software engineer', jobage_0: 'test' }

简写方法名
直接看：
let person = { 
let person = { 
    // sayName: function(name) { // 旧
    //     console.log(`My name is ${name}`); 
    // } 
    sayName(name) { // 新
        console.log(`My name is ${name}`); 
    } 
}; 
person.sayName('Matt'); // My name is Matt

简写方法名对获取函数和设置函数也是适用的，并且简写方法名与可计算属性键相互兼容，也为后文的类打下了基础
对象解构
// 对象解构
let person = { 
    name: 'cosine', 
    age: 21 
}; 
let { name: personName, age: personAge } = person; 
console.log(personName, personAge); // cosine 21 
// 让变量直接使用属性的名称 定义默认值 若未定义默认值则不存在的则为undefined
let { name, age, job = 'test', score } = person; 
console.log(name, age, job, score); // cosine 21 test undefined

解构在内部使用函数 ToObject()（不能在运行时环境中直接访问）把源数据结构转换为对象。 这意味着在对象解构的上下文中，原始值会被当成对象。也就是说：null 和 undefined 不能被解构，否则会抛出错误
let { length } = 'foobar'; 
console.log(length); // 6 
let { constructor: c } = 4; 
console.log(c === Number); // true 
let { _ } = null; // TypeError 
let { _ } = undefined; // TypeError

想要给事先声明的变量解构赋值，则赋值表达式必须包含在一对括号中
let personName, personAge; 
let person = { 
 name: 'cosine', 
 age: 21
}; 
({name: personName, age: personAge} = person); 
console.log(personName, personAge); // cosine 21

1、嵌套解构
解构对于引用嵌套的属性或赋值目标没有限制。为此，可以通过解构来复制对象属性(浅复制)
let person = { 
    name: 'cosine', 
    age: 21, 
    job: { 
        title: 'Software engineer' 
    } 
}; 
// 声明 title 变量并将 person.job.title 的值赋给它
let { job: { title } } = person; 
console.log(title); // Software engineer

在外层属性没有定义的情况下不能使用嵌套解构。无论源对象还是目标对象都一样
2、部分解构
涉及多个属性的解构赋值是一个输出无关的顺序化操作。如果一个解构表达式涉及多个赋值，开始的赋值成功而后面的赋值出错（对不能解构的undefined || null进行解构），则整个解构赋值只会完成一部分
3、参数上下文匹配
在函数参数列表中也可以进行解构赋值。对参数的解构赋值不会影响 arguments 对象，但可以在函数签名中声明在函数体内使用局部变量：
let person = { 
    name: 'cosine', 
    age: 21
}; 
function printPerson(foo, {name, age}, bar) { 
    console.log(arguments); 
    console.log(name, age); 
} 
function printPerson2(foo, {name: personName, age: personAge}, bar) { 
    console.log(arguments); 
    console.log(personName, personAge); 
} 
printPerson('1st', person, '2nd'); 
// ['1st', { name: 'cosine', age: 21 }, '2nd'] 
// 'cosine' 21 
printPerson2('1st', person, '2nd'); 
// ['1st', { name: 'cosine', age: 21 }, '2nd'] 
// 'cosine' 21

创建对象
ES6开始，正式支持了类和继承，不过这种支持其实是封装了ES5.1构造函数加原型继承的语法糖。
工厂模式
在设计模式那篇博客有提到一些设计模式 (前端设计模式应用笔记)， 而工厂模式也是一种广泛使用的设计模式，它提供了一种创建对象的最佳方式。在工厂模式中，我们在创建对象时不会对客户端暴露创建逻辑，并且是通过使用一个共同的接口来指向新创建的对象。
function createPerson(name, age, job) { 
    let o = new Object(); 
    o.name = name; 
    o.age = age; 
    o.job = job; 
    o.sayName = function() { 
        console.log(this.name); 
    }; 
    return o; 
} 
let person1 = createPerson("cosine", 21, "Software Engineer"); 
let person2 = createPerson("Greg", 27, "Doctor"); 
console.log(person1);   // { name: 'cosine', age: 21, job: 'Software Engineer', sayName: [Function (anonymous)] }
person1.sayName();  // cosine
console.log(person2); // { name: 'Greg', age: 27, job: 'Doctor', sayName: [Function (anonymous)] }
person2.sayName();  // Greg

这种模式可以解决创建多个类似对象的问题，但没有解决对象标识问题（即新创建的对象是什么类型）
构造函数模式
自定义构造函数，以函数的形式为自己的对象类型定义属性和方法。
function Person(name, age, job){ 
    this.name = name; 
    this.age = age; 
    this.job = job; 
    this.sayName = function() { 
        console.log(this.name); 
    }; 
} 
let person1 = new Person("cosine", 21, "Software Engineer"); 
person1.sayName(); // cosine


没有显式地创建对象
属性和方法直接赋值给了 this
没有 return
要创建 Person 的实例，应使用 new 操作符

new 过程中发生了什么？
划重点，使用new调用构造函数会执行如下几个操作：

在内存中创建一个新对象
将新对象内部的 [[Prototype]] 赋值为构造函数的prototype属性。
构造函数内部的 this 指向这个新对象
执行构造函数内部的代码（为对象添加属性）
若构造函数返回非空对象，则返回该对象。否则，返回刚创建的新对象！

上一个栗子的最后，person1有一个constructor属性指向Person
console.log(person1.constructor)    // [Function: Person]
console.log(person1.constructor === Person)    // true
console.log(person1 instanceof Object); // true 
console.log(person1 instanceof Person); // true

定义自定义构造函数可以确保实例被标识为特定类型，相比于工厂模式，这是一个很大的好处。 person1 之所以也被认为是 Object 的实例，是因为所有自定义对象都继承自 Object（后文会提到）
注意以下几点：

构造函数也是函数 ：任何函数只要使用 new 操作符调用就是构造函数，而不使用 new 操作符调用的函数就是普通函数
构造函数的主要问题：其定义的方法会在每个实例上都创建一遍，因此不同实例上的函数虽然同名却不相等，而因为都是做一样的事，所以没必要定义两个不同的 Function 实例。

this 对象可以把函数与对象的绑定推迟到运行时，所以可以将函数定义转移到构造函数外部。 这样虽然解决了相同逻辑的函数重复定义的问题，但全局作用域也因此被搞乱了，因为那个函数实际上只能在一个对象上调用。如果这个对象需要多个方法，那么就要在全局作用域中定义多个函数。这会导致自定义类型引用的代码不能很好地聚集一起。而这个新问题可以通过原型模式来解决
原型模式

每个函数都会创建一个 prototype 属性指向原型对象
在原型对象上定义的属性和方法可以被所有对象实例共享
原来在构造函数中赋给对象实例的值，可以直接赋值给它们的原型

1、理解原型

无论何时，只要创建一个函数，就会按照特定的规则为这个函数创建一个 prototype 属性指向原型对象
所有原型对象会获得一个名为 constructor 的属性，指回与之关联的构造函数
如Person.prototype.constructor 指向 Person


然后，可通过构造函数给原型对象添加其他属性和方法
原型对象默认只会获得 constructor 属性，其他的所有方法都继承自 Object
每次调用构造函数创建一个新实例，其的内部[[Prototype]]指针就会被赋值为构造函数的原型对象
脚本中没有访问这个 [[Prototype]] 特性的标准方式，但 Firefox、Safari 和 Chrome 会在每个对象上暴露 __proto__ 属性，通过这个属性可以访问对象的原型

正常的原型链都会终止于 Object 的原型对象，而 Object 原型的原型为 null
console.log(Person.prototype.__proto__ === Object.prototype); // true 
console.log(Person.prototype.__proto__.constructor === Object); // true 
console.log(Person.prototype.__proto__.__proto__ === null); // true

构造函数、原型对象和实例是 3 个完全不同的对象：
console.log(person1 !== Person); // true 
console.log(person1 !== Person.prototype); // true 
console.log(Person.prototype !== Person); // true

实例通过 __proto__ 链接到原型对象，构造函数通过 prototype 属性链接到原型对象:
console.log(person1.__proto__ === Person.prototype); // true 
conosle.log(person1.__proto__.constructor === Person); // true

同一个构造函数创建的实例共享同一个原型对象，而 instanceof 检查实例的原型链中是否包含指定构造函数的原型：
console.log(person1.__proto__ === person2.__proto__); // true 
console.log(person1 instanceof Person); // true 
console.log(person1 instanceof Object); // true


isPrototypeOf() 方法用于测试一个对象是否存在于另一个对象的原型链上。
与 instanceof 运算符不同。在表达式 object instanceof AFunction中，object 的原型链是针对 AFunction.prototype 进行检查的，而不是针对 AFunction 本身。


getPrototypeOf()方法，返回参数的内部特性 [[Prototype]] 的值
使用它可以很方便的取得一个对象的原型，这在通过原型实现继承时尤为重要。


setPrototypeOf() 方法，可以向实例的私有特性 [[Prototype]] 写入一个新值。
使用它可以重写一个对象的原型继承关系



console.log(Person.prototype.isPrototypeOf(person1)); // true 
console.log(Person.prototype.isPrototypeOf(person2)); // true
console.log(Object.getPrototypeOf(person1) == Person.prototype); // true 
console.log(Object.getPrototypeOf(person1).name); // "cosine"


Object.setPrototypeOf() 可能会严重影响代码性能。Mozilla 文档说得很清楚：“在所有浏览器和 JavaScript 引擎中，修改继承关系的影响都是微妙且深远的。这种影响并不仅是执行 Object.setPrototypeOf()语句那么简单，而是会涉及所有访问了那些修改了 [[Prototype]] 的对象的代码。

为避免使用 Object.setPrototypeOf() 可能造成的性能下降，可以通过 Object.create() 来创建一个新对象，同时为其指定原型：
let biped = { 
 numLegs: 1
}; 
let person = Object.create(biped); 
person.name = 'cosine'; 
console.log(person.name); // cosine
console.log(person.numLegs); // 1
console.log(Object.getPrototypeOf(person) === biped); // true

2、原型层级

通过对象访问属性时，会按照该属性名称进行搜索。
如果在这个实例上发现了这个属性，则返回该这个属性对应值。
如果在该实例上没有找到，则会进入原型对象，在原型对象上找到属性后，返回对应的值。
如果原型对象上没有找到，再到原型对象的原型对象上找……如此往复，直至找到
这既是原型用于在多个对象实例间共享属性和方法的原理。

注意以下几点：

虽然可以通过实例读取原型对象上的值，但不可能通过实例重写原型对象上的值
在实例上添加了一个与原型对象中同名的属性，则会在实例上创建这个属性，这个属性会遮住原型对象上的属性
使用 delete 操作符可以完全删除实例上的这个属性，从而使标识符解析过程能够继续搜索原型对象

hasOwnProperty()
hasOwnProperty() 方法用于确定某个属性是在实例上还是在原型对象上。这个方法会在属性存在于调用它的对象实例上时返回 true
function Person() {} 
Person.prototype.name = "cosine"; 
Person.prototype.age = 21; 
Person.prototype.job = "Software Engineer"; 
Person.prototype.sayName = function() { 
    console.log(this.name); 
}; 
let person1 = new Person(); 
let person2 = new Person(); 

console.log(person1.hasOwnProperty("name")); // false 
person1.name = "Khat";         // 添加了实例上的name， 遮蔽了原型上的name

console.log(person1.name); // "Khat"，来自实例
console.log(person1.hasOwnProperty("name")); // true 

console.log(person2.name); // "cosine"，来自原型
console.log(person2.hasOwnProperty("name")); // false 

delete person1.name; 
console.log(person1.name); // "cosine"，来自原型
console.log(person1.hasOwnProperty("name")); // false

3、原型和in操作符
in 操作符有以下两种使用方式：

单独使用 in 操作符
在 for-in 循环中使用

单独使用时，通过对象访问指定属性时返回 true，无论该属性是在实例上还是在原型上
console.log(person1.hasOwnProperty("name")); // false 
console.log("name" in person1); // true 

person1.name = "cosine"; 
console.log(person1.name); // "Khat"，来自实例
console.log(person1.hasOwnProperty("name")); // true 
console.log("name" in person1); // true 

console.log(person2.name); // "cosine"，来自原型
console.log(person2.hasOwnProperty("name")); // false 
console.log("name" in person2); // true 

delete person1.name; 
console.log(person1.name); // "cosine"，来自原型
console.log(person1.hasOwnProperty("name")); // false 
console.log("name" in person1); // true

如果要确定某个属性是否存在于原型上，则可以同时使用 hasOwnProperty() 和 in 操作符
function hasPrototypeProperty(object, name){ 
    return !object.hasOwnProperty(name) && (name in object); 
} ;

在 for-in 循环中使用 in 操作符时，可以通过对象访问且可以被枚举的属性都会返回，包括可枚举的实例属性、原型属性（不包括被遮蔽的原型属性和不可枚举的属性），除此之外，Object.keys() 方法也可以获得对象上所有可枚举的实例属性，其返回一个包括该对象所有可枚举属性名称的字符串数组
若想获得所有实例属性（包括不可枚举），则可以用 Object.getOwnPropertyNames()
4、属性枚举顺序

枚举顺序不确定
for-in 循环
Object.keys()
取决于 JavaScript 引擎，可能因浏览器而异。


枚举顺序确定
Object.getOwnPropertyNames()
Object.getOwnPropertySymbols()
Object.assign()
先以 升序 枚举数值键，然后以 插入顺序 枚举字符串和符号键。



对象迭代
ECMAScript 2017 新增了两个静态方法，用于将对象内容转换为序列化的（可迭代的）格式。这两个静态方法 Object.values() 和 Object.entries() 接收一个对象，返回它们内容的数组。

Object.values() 返回对象值的数组
Object.entries() 返回键-值对的数组
非字符串属性会被转换为字符串输出，符号属性则会被忽略。这两个方法执行的是对象的浅复制

1、 其他原型语法
为了减少代码冗余，从视觉上更好地封装原型功能，直接通过一个包含所有属性和方法的对象字面量来重写原型成为了一种常见的做法
function Person() {} 
Person.prototype = {
    name: "cosine", 
    age: 21, 
    job: "Software Engineer", 
    sayName() { 
    console.log(this.name); 
    } 
};

但有一个问题：这样重写后，Person.prototype 的 constructor 属性就不指向 Person了。在创建函数时，也会创建它的 prototype 对象，同时会自动给这个原型的constructor 属性赋值。因此我们需要专门设置一下constructor的值
Person.prototype = { 
    constructor: Person, // 赋值
    name: "cosine", 
    age: 21, 
    job: "Software Engineer", 
    sayName() { 
        console.log(this.name); 
    } 
};

以这种方式恢复 constructor 属性会创建一个[[Enumerable]] 为 true 的属性。而 原生 constructor 属性默认是不可枚举的。因此，如果你使用的是兼容 ECMAScript 的 JavaScript 引擎，那可能需要改为使用 Object.defineProperty() 方法来定义 constructor 属性
2、 原型的动态性
因为从 原型上搜索值 的过程是动态的，所以即使实例在修改原型之前已经存在，任何时候对原型对象所做的修改也会在实例上反映出来：
function Person() {} 
let friend = new Person(); 
Person.prototype = { 
    constructor: Person, 
    name: "cosine", 
    age: 21, 
    job: "Software Engineer", 
    sayName() { 
        console.log(this.name); 
    } 
}; 
friend.sayName(); // 错误

3、 原生对象原型

原型模式是实现所有原生引用类型的模式。
所有原生引用类型的构造函数（包括 Object、Array 、 String 等）都在原型上定义了实例方法。
数组实例的 sort() 等方法就是 Array.prototype 上定义
字符串包装对象的 substring() 等方法也是在 String.prototype 上定义


通过原生对象的原型可以取得所有默认方法的引用，也可以给原生类型的实例定义新的方法（但不建议这么做x）

4、 原型的问题

弱化了向构造函数传递初始化参数的能力，会导致所有实例默认都取得相同的属性值
最主要问题源自它的共享特性，一般来说，不同的实例应该有属于自己的属性副本，而原型模式新增的属性会在不同实例上反映出来

继承实现
原型链

ECMA-262 将原型链定义为ECMAScript的 主要继承方式
基本思想：通过原型，继承多个引用类型的属性与方法。

回顾一下：每个构造函数有一个原型对象，通过 prototype 指向原型对象，原型dx有一个属性 constructor 指回构造函数，实例有一个内部指针 __proto__ 指向原型。
那如果原型是另一个类型的实例呢？那就意味着这个原型本身有一个内部指针 __proto__ 指向另一个原型对象。相应地另一个原型也有另一个指针 constructor 指向另一个构造函 数，这样就在实例和原型之间构造了一条原型链。
原型链扩展了前面描述的原型搜索机制。我们知道，在读取实例上的属性时，首先会在实例上搜索这个属性。如果没找到，则会继承搜索实例的原型。在通过原型链实现继承之后，搜索就可以向上，搜索原型的原型。直至原型链的末端
1、默认原型
默认情况下，所有引用类型都继承自 Object，这也是通过原型链实现的。任何函数的默认原型都是一个 Object 的实例，这意味着这个实例有一个内部指针指向 Object.prototype。这也是为什么自定义类型能够继承包括 toString()、valueOf()在内的所有默认方法的原因。
2、原型与继承关系
原型与实例的关系可以通过两种方式来确定。

使用 instanceof 操作符，如果一个实例的原型链中出现过相应的构造函数，则 instanceof 返回 true

console.log(instance instanceof Object); // true 
console.log(instance instanceof SuperType); // true 
console.log(instance instanceof SubType); // true


使用 isPrototypeOf() 方法。只要该实例原型链中包含这个原型，这个方法就返回 true

console.log(Object.prototype.isPrototypeOf(instance)); // true 
console.log(SuperType.prototype.isPrototypeOf(instance)); // true 
console.log(SubType.prototype.isPrototypeOf(instance)); // true

3、原型链的问题

在谈到原型的问题时也提到过，原型中包含的引用值会在所有实例间共享，这也是为什么属性通常会在构造函数中定义而不会定义在原型上的原因。
在使用原型实现继承时，原型实际上变成了另一个类型的实例。这意味着原先的实例属性

function SuperType() { 
    this.colors = ["red", "blue", "green"]; 
} 

function SubType() {} 

// 继承 SuperType 
SubType.prototype = new SuperType(); 

let instance1 = new SubType(); 
instance1.colors.push("black"); 
console.log(instance1.colors); // "red,blue,green,black" 

let instance2 = new SubType(); 
console.log(instance2.colors); // "red,blue,green,black"

当 SubType 通过原型继承 SuperType 后，SubType.prototype 变成了 SuperType 的一个实例，因而也获得了自己的 colors 属性。这类似于创建了 SubType.prototype.colors 属性。最终结果是，SubType 的所有实例都会共享这个 colors 属性，instance1.colors 上的修改也会反映到 instance2.colors上

第二个问题是，子类型在实例化时不能给父类型的构造函数传参。事实上，我们无法在不 影响所有对象实例的情况下把参数传进父类的构造函数。再加上之前提到的原型中包含引用值的问题，就导致原型链基本不会被单独使用

盗用构造函数
基本思路：在子类构造函数中调用父类构造函数。 函数就是在特定上下文中执行代码的简单对象，所以可以使用 apply() 和 call() 方法以新创建的对象为上下文执行构造函数。
function SuperType() { 
    this.colors = ["red", "blue", "green"]; 
} 
function SubType() { 
    // 继承 SuperType !!
    SuperType.call(this); 
} 
let instance1 = new SubType(); 
instance1.colors.push("black"); 
console.log(instance1.colors); // "red,blue,green,black" 

let instance2 = new SubType(); 
console.log(instance2.colors); // "red,blue,green"

通过使用 call()（或 apply()）方法，SuperType构造函数在为 SubType 的实例创建的新对象的上下文中执行了。这相当于新的 SubType 对象上运行了 SuperType() 函数中的所有初始化代码！这样每个实例就有自己的属性了
1、传递参数
使用盗用构造函数可以在子类构造函数中向父类构造函数传参。
function SuperType(name){ 
    this.name = name; 
} 
function SubType() { 
    // 继承 SuperType 并传参
    SuperType.call(this, "cosine"); 
    // 实例属性
    this.age = 21; 
} 
let instance = new SubType(); 
console.log(instance.name); // "cosine"; 
console.log(instance.age); // 21

2、主要问题
盗用构造函数的主要缺点，也是使用构造函数模式自定义类型的问题：

必须在构造函数中定义方法。因此函数不能重用
子类不能访问父类原型上定义的方法，因此所有类型只能使用构造函数模式

由于存在这些问题，盗用构造函数基本上也不能单独使用。
组合式继承
组合继承综合了原型链和盗用构造函数，将两者的优点集中了起来。

基本的思路是使用原型链继承原型上的属性和方法，而通过盗用构造函数继承实例属性
既可以把方法定义在原型上以实现重用，又可以让每个实例都有自己的属性

function SuperType(name){ 
    this.name = name; 
    this.colors = ["red", "blue", "green"]; 
} 
SuperType.prototype.sayName = function() { 
    console.log(this.name); 
}; 
function SubType(name, age){ 
    // 继承属性
    SuperType.call(this, name); 
    this.age = age; 
} 
// 继承方法
SubType.prototype = new SuperType(); 
SubType.prototype.sayAge = function() { 
    console.log(this.age); 
}; 
let instance1 = new SubType("cosine", 21); 
instance1.colors.push("black"); 
console.log(instance1.colors); // "red,blue,green,black" 
instance1.sayName(); // "cosine"; 
instance1.sayAge(); // 21 
let instance2 = new SubType("NaHCOx", 22); 
console.log(instance2.colors); // "red,blue,green" 
instance2.sayName(); // "NaHCOx"; 
instance2.sayAge(); // 22

原型式继承
适用情形：已有一个对象，想在它的基础上再创建一个新对象。你需要把这个对象先传给 object()，然后再对返回的对象进行适当修改。
let person = { 
    name: "Nicholas", 
    friends: ["Shelby", "Court", "Van"] 
}; 
let anotherPerson = Object.create(person, { 
    name: { 
        value: "Greg" 
    } 
}); 
console.log(anotherPerson.name); // "Greg"

非常适合以下几种情形：

不需要单独创建构造函数
并且需要在对象间共享信息的场合
注意：属性中包含的引用值始终会在相关对象间共享

寄生式继承
与原型式继承比较接近的一种继承方式是寄生式继承（parasitic inheritance） 创建一个实现继承的函数，以某种方式增强对象，然后返回这个对象。 基本的寄生继承模式如下
function createAnother(original) {
    let clone = Object.create(original);   // 调用构造函数创建一个新对象
    clone.sayHi = function() {
        console.log(`Hi! I am ${this.name}`);
    };
    return clone;   // 返回这个对象
}
let person = {
    name: "cosine",
    friends: ['NaHCOx', 'Khat']
};
let person2 = createAnother(person);
person2.name = 'CHxCOOH';
person2.sayHi();    // Hi! I am CHxCOOH

该例子通过person为源对象，返回一个增加了sayHi函数的新对象（进行了增强），主要适用于关注对象而不在乎构造函数和类型的场景
需要注意的一点是：

通过寄生式继承给对象添加函数会导致函数难以重用，与构造函数模式类似

寄生式组合继承
组合继承也有效率问题，比如父类构造函数始终会被调用两次

在创建子类原型时调用
在子类构造函数中调用

function SuperType(name){ 
    this.name = name; 
    this.colors = ["red", "blue", "green"]; 
} 
SuperType.prototype.sayName = function() { 
    console.log(this.name); 
}; 
function SubType(name, age){ 
    // 继承属性
    SuperType.call(this, name); // 第二次调用父类构造函数！
    this.age = age; 
} 
// 继承方法
SubType.prototype = new SuperType(); // 第一次调用父类构造函数！
SubType.prototype.sayAge = function() { 
    console.log(this.age); 
};

本质上，子类的原型最终是要包含父类对象的所有实例属性，所以子类构造函数只需要在执行时 重写 自己的原型就可以了。
寄生式组合继承主要思路如下：

通过 盗用构造函数 继承属性
使用 混合式原型链 继承方法 也就是说，将父类原型拿来，并用指向子类的constructor遮蔽原有constructor,

function inheritPrototype(subType, superType) {
    let prototype = Object.create(superType.prototype); // 创建父类原型的一个副本
    prototype.constructor = subType;    // 找回重写原型导致丢失的constructor
    subType.prototype = prototype;      // 赋值对象
}
function SuperType(name){ 
    this.name = name; 
    this.colors = ["red", "blue", "green"]; 
} 
SuperType.prototype.sayName = function() { 
    console.log(this.name); 
}; 
function SubType(name, age){ 
    // 继承属性
    SuperType.call(this, name); // 第二次调用父类构造函数！
    this.age = age; 
} 
// 继承方法
- SubType.prototype = new SuperType(); // 第一次调用父类构造函数！
+ inheritPrototype(SubType, SuperType);    // 变成调用这个函数
SubType.prototype.sayAge = function() { 
    console.log(this.age); 
};

避免了不必要的多次调用父类构造函数，也保证了原型链不变，可以算是引用类型继承的最佳模式~

JavaScript中的类
上一节都是基于ES5的特性来模拟实现类似于类class的行为，不难看出这些方法各有各自的问题，实现继承的代码也显得非常冗长和混乱。因此，ES6 中新引入的 class 关键字具备了正式定义类的能力，它实际上是一个语法糖，背后使用的仍然是原型和构造函数的概念。
类定义
类声明与类表达式两种定义方法，都使用 class 关键字
// 类声明
class Person {}     

// 类表达式
const Animal = class {}

与函数表达式类似，类表达式在它们被求值前也不能引用。 但不同之处在于

函数声明可以提升，而类定义不能提升
函数受 函数作用域 限制，类受 块作用域 限制

// 函数声明可以提升，而类定义不能提升*
console.log(FunctionExpression); // undefined 
var FunctionExpression = function() {}; 
console.log(FunctionExpression); // function() {}

console.log(ClassExpression); // undefined 
var ClassExpression = class {}; 
console.log(ClassExpression); // class {} 
// 函数受函数作用域限制，类受块作用域限制
{ 
    function FunctionDeclaration() {} 
    class ClassDeclaration {} 
} 
console.log(FunctionDeclaration); // FunctionDeclaration() {} 
console.log(ClassDeclaration); // ReferenceError: ClassDeclaration is not defined

类构成
类可以包括以下方法，但都不是必须的，空的类定义仍然有效。

构造函数（constructor）
获取函数及设置函数（get和set）
静态类方法（static）
其他实例方法

默认情况下，类定义中的代码都在 严格模式 下执行。 首字母大写这个就不必多说了，可以用于区分通过他创建的实例
类表达式的名称是可选的。在把类表达式赋值给变量后，可以通过 name 属性取得类表达式的名称字符串。但不能在类表达式作用域外部访问这个标识符。
let Person = class PersonName { 
    identify() { 
        console.log(Person.name, PersonName.name); 
    } 
} 
let p = new Person(); 
p.identify(); // PersonName PersonName 
console.log(Person.name); // PersonName 
console.log(PersonName); // ReferenceError: PersonName is not defined

类构造函数
constructor 关键字用于在类定义块内部创建类的构造函数。

constructor 会告诉解释器：使用 new 操作符创建类的新实例时，应该调用这个函数。
构造函数的定义不是必需的，不定义构造函数相当于将构造函数定义为空函数。

1、实例化
constructor函数实际上也是个语法糖，他让 JS 解释器知道使用 new 来定义类的一个实例时应使用 constructor 函数进行实例化。
让我们复习一下使用 new 调用构造函数所执行的操作：

在内存中创建一个新对象 let obj = new Object()
将新对象内部的 [[Prototype]] 赋值为构造函数的 prototype obj.__proto__ = constructor.prototype;
构造函数内部的 this 指向这个新对象
执行这个构造函数内部代码
上述两步 相当于 let res = contructor.apply(obj, args)


若构造函数返回 非空对象， 则返回该对象 res；否则，返回刚创建的新对象 obj
return typeof res === 'object' ? res: obj;



类实例化时传入的参数会作为构造函数的参数，若不需要参数，则类名后面的括号也是可选的 可以直接 new Person
类构造函数会在执行之后返回一个对象，这个对象会被用作实例化的对象。 注意：若构造函数返回的这个对象 res 是一个非空对象，且这个对象与new中第一步新建的对象obj无关系，则新建的对象会被回收哦，而且通过 instanceof 检测是无法检测出跟该类有关联，因为并没有修改原型指针。
2、类的本质？
class Person {} 
console.log(Person); // class Person {} 
console.log(typeof Person); // function

是函数！前面也说到了，它本质上就是一个语法糖，所以它具有跟函数一样的行为。 可以向其他对象或函数引用一样将其当作参数传递，也可以立即实例化（类似函数表达式的立即执行）
// 类可以像函数一样在任何地方定义，比如在数组中
let classList = [ 
    class { 
        constructor(id) { 
            this.id_ = id; 
            console.log(`instance ${this.id_}`); 
        } 
    } 
]; 
function createInstance(classDefinition, id) { 
    return new classDefinition(id); 
} 
let foo = createInstance(classList[0], 3141); // instance 3141 

// 立即执行
let p = new class Foo { 
    constructor(x) { 
        console.log(x); 
    } 
}('bar'); // bar 
console.log(p); // Foo {}

实例、原型和类成员
类可以非常方便的定义以下三种成员，跟其它语言相似。

实例上的成员
原型上的成员
类本身的成员（静态类成员）

实例成员
在constructor 中可以通过this为新创建的实例添加自有属性，每个实例是不会共享这里的属性的。

ps：在类块中直接写的成员也会成为实例属性

class Person { 
    sex = '女'
    age = 21
    constructor() { 
        // 这个例子先使用对象包装类型定义一个字符串
        // 为的是在下面测试两个对象的相等性
        this.name = new String('Jack'); 
        this.sayName = () => console.log(this.name); 
        this.nicknames = ['Jake', 'J-Dog'] 
    } 
} 
let p1 = new Person(), 
 p2 = new Person(); 
p1.sayName(); // Jack 
p2.sayName(); // Jack 
console.log(p1.name === p2.name); // false 
console.log(p1.sayName === p2.sayName); // false 
console.log(p1.nicknames === p2.nicknames); // false 
console.log(p1.sex, p1.age) // 女 21

原型成员
将在类块中定义的方法作为原型方法（在所有实例中共享）
class Person { 
    constructor() { 
        // 添加到 this 的所有内容都会存在于不同的实例上
        this.locate = () => console.log('instance'); 
    } 
    // 在类块中定义的所有内容都会定义在类的原型上
    locate() { 
        console.log('prototype'); 
    } 
} 
let p = new Person(); 
p.locate(); // instance 
Person.prototype.locate(); // prototype

类定义也支持获取和设置访问器。语法与行为跟普通对象一样：
class Person { 
    sex = '女'
    age = 21
    constructor() { 
        this.sayName = () => console.log(this.name); 
        this.nicknames = ['Jake', 'J-Dog'] 
    }
    set name(newName) { 
        this.name_ = newName; 
    } 
    get name() { 
        return this.name_; 
    } 
} 
let p = new Person(); 
p.name = 'cosine'; 
console.log(p.name); // cosine

静态类方法
静态类成员在类定义中使用 static 关键字作为前缀。在静态成员中，this 引用类自身。可以通过类名.方法名直接访问
非函数原型和类成员
虽然类定义并不显式支持在原型或类上添加成员数据，但在类定义外部，可以手动添加：
// 在类上定义数据成员
Person.greeting = 'My name is'; 
// 在原型上定义数据成员
Person.prototype.name = 'Jake';


但是不建议这么做，在原型和类上添加可变数据成员是一种反模式。一般来说，对象实例应该独自拥有通过 this 引用的数据

迭代器与生成器方法
类定义语法支持在原型和类本身上定义生成器方法：
class Person { 
    // 在原型上定义生成器方法
    *createNicknameIterator() { 
        yield 'cosine1'; 
        yield 'cosine2'; 
        yield 'cosine3'; 
    } 
    // 在类上定义生成器方法
    static *createJobIterator() { 
        yield 'bytedance'; 
        yield 'mydream'; 
        yield 'bytedance mydream!'; 
    } 
} 
let jobIter = Person.createJobIterator(); 
console.log(jobIter.next().value); // bytedance 
console.log(jobIter.next().value); // mydream 
console.log(jobIter.next().value); // bytedance mydream!
let p = new Person(); 
let nicknameIter = p.createNicknameIterator(); 
console.log(nicknameIter.next().value); // cosine1 
console.log(nicknameIter.next().value); // cosine2 
console.log(nicknameIter.next().value); // cosine3

因为支持生成器方法，所以可以通过添加一个默认的迭代器，把类实例变成可迭代对象
class People { 
    constructor() { 
        this.nicknames = ['cosine1', 'cosine2', 'cosine3']; 
    } 
    *[Symbol.iterator]() { 
        yield *this.nicknames.entries(); 
    } 
} 
let workers = new People(); 
for (let [idx, nickname] of workers) { 
    console.log(idx, nickname); 
}
// 0 cosine1
// 1 cosine2
// 2 cosine3

继承
ES 6最出色的一点就是原生支持了类继承机制，是之前原型链的一个语法糖
继承基础
ES6 类支持单继承，使用 extends 关键字，可以继承一个类，也可以继承普通的构造函数（保持向后兼容）

派生类可以通过原型链访问到类和原型上定义的方法
this 的值会反映调用相应方法的实例或者类。
extends 关键字也可以在类表达式中使用

构造函数、HomeObject 和 super()

派生类的方法可以通过 super 关键字引用它们的原型
只能在派生类中使用
仅限于类构造函数、实例方法和静态方法内部
在类构造函数中使用 super 可以调用父类构造函数。


[[HomeObject]]
ES6 给类构造函数和静态方法添加了内部特性 [[HomeObject]]
指向定义该方法的对象的指针，这个指针是自动赋值的，而且只能在 JavaScript 引擎内部访问。


super 始终会定义为 [[HomeObject]] 的原型。

在使用 super 时要注意几个问题

super 只能在 派生类的构造函数和静态方法中使用
不能单独引用 super 关键字，要么用它调用构造函数，要么用它引用静态方法
调用 super() 会调用父类构造函数，并将返回的实例赋值给 this，所以不能在调用 super() 之前引用 this
需要给父类构造函数传参，则需要手动将其传入super
如果没有定义类构造函数，在实例化派生类时会调用 super()，而且会传入所有传给派生类的参数
如果在派生类中显式定义了构造函数，则要么必须在其中调用 super()，要么必须显式的返回一个对象。

抽象基类
抽象基类也就是一种可供其他类继承，但本身不会被实例化的类。在其他语言中也有这种概念。虽然 ECMAScript 没有专门支持这种类的语法 ，但通过 new.target 也很容易实现

new.target 保存通过 new 关键字调用的类或函数
通过在实例化时检测 new.target 是不是抽象基类，可以阻止对抽象基类的实例化

// 抽象基类 
class Vehicle { 
    constructor() { 
        console.log(new.target); 
        if (new.target === Vehicle) { 
            throw new Error('Vehicle cannot be directly instantiated'); 
        } 
    } 
} 
// 派生类
class Bus extends Vehicle {} 
new Bus(); // class Bus {} 
new Vehicle(); // class Vehicle {} 
// Error: Vehicle cannot be directly instantiated

通过在抽象基类的构造函数中进行检查，可以要求派生类必须定义某个方法。因为原型方法在调用原型类的构造函数之前就已经存在了，所以可以通过 this 关键字来检查相应的方法是否定义
// 抽象基类
class Vehicle { 
    constructor() { 
        if (new.target === Vehicle) 
            throw new Error('Vehicle cannot be directly instantiated'); 
        if (!this.foo)
            throw new Error('Inheriting class must define foo()'); 
        console.log('success!'); 
    } 
} 
// 派生类
class Bus extends Vehicle { foo() {} } 
// 派生类
class Van extends Vehicle {} 
new Bus(); // success! 
new Van(); // Error: Inheriting class must define foo()

继承内置类型
ES6 类为继承内置引用类型提供了顺畅的机制，开发者可以方便地扩展内置类型，如下，向Array添加了一个洗牌算法的方法
class SuperArray extends Array { 
    shuffle() { 
        // 加一个洗牌算法
        for (let i = this.length - 1; i > 0; i--) { 
            const j = Math.floor(Math.random() * (i + 1)); //生成[0, i+1)的随机数
            [this[i], this[j]] = [this[j], this[i]];    // 交换两张牌
        } 
    } 
} 
let a = new SuperArray(1, 2, 3, 4, 5); 
console.log(a instanceof Array); // true 
console.log(a instanceof SuperArray); // true
console.log(a); // [1, 2, 3, 4, 5] 
a.shuffle(); 
console.log(a); // 随机的新数组
a.shuffle(); 
console.log(a); // 随机的新数组

有些内置类型的方法会返回新实例。默认情况下，返回实例的类型与原始实例的类型是一致的，但如果想覆盖这个默认行为，则可以覆盖 Symbol.species 访问器，这个访问器决定在创建返回的实例时使用的类
class SuperArray extends Array { 
    static get [Symbol.species]() { 
        return Array; 
    } 
} 
let a1 = new SuperArray(1, 2, 3, 4, 5); 
let a2 = a1.filter(x => !!(x%2)) 
console.log(a1); // [1, 2, 3, 4, 5] 
console.log(a2); // [1, 3, 5] 
console.log(a1 instanceof SuperArray, a1 instanceof Array); // true true
console.log(a2 instanceof SuperArray, a2 instanceof Array); // false true

类混入（多继承的模拟实现）
将不同类的行为集中到一个类是一种常见的 JavaScript 模式。虽然 ES6 没有显式支持多类继承，但通过现有特性可以轻松地模拟这种行为。
首先要注意以下两点：

如果只是需要混入多个对象的属性，那么使用 Object.assign() 就可以了。
Object.assign() 方法是为了专门为了混入对象行为而设计的。只有在需要混入类的行为时才有必要自己实现混入表达式。


很多 JavaScript 框架（特别是 React）已经抛弃混入模式，转向了组合模式
组合即是把方法提取到独立的类和辅助对象中，然后把它们组合起来，不使用继承。
众所周知的软件设计原则：“组合胜过继承（composition over inheritance）。”



extends 关键字后面可以是一个 JavaScript 表达式。任何可以解析为一个类或一个构造函数的表达式都是有效的。这个表达式会在求值类定义时被求值，这就是类混入的原理
如 Person 类需要组合类A、B、C，则需要某种机制实现 B 继承 A，C 继承 B，而 Person再继承C从而实现将A、B、C组合至这个超类中：
class Vehicle {} 
let AMixin = (Superclass) => class extends Superclass { 
    afunc() { console.log('A Mixin'); } 
}; 
let BMixin = (Superclass) => class extends Superclass { 
    bfunc() { console.log('B Mixin'); } 
}; 
let CMixin = (Superclass) => class extends Superclass { 
    cfunc() { console.log('C Mixin'); } 
}; 
function mixin(BaseClass, ...Mixins) { 
    return Mixins.reduce((accumulator, current) => current(accumulator), BaseClass); 
} 
class Bus extends mixin(Vehicle, AMixin, BMixin, CMixin) {} 
let b = new Bus(); 
b.afunc(); // A Mixin 
b.bfunc(); // B Mixin 
b.cfunc(); // C Mixin

