不考虑重边和自回路

抽象数据类型定义
类型名称：图(Graph) 数据对象集：G(V,E)由一个非空的有限顶点集合V和一个有限边集合E组成。 操作集：对于任意图G ∈ Graph,以及 v ∈ V，e ∈ E

