二、最短路径问题
1.概念简介

在网络中，求两个不同顶点之间的所有路径中，边的权值之和最小的那一条路径
这条路径就是两点之间的最短路径(Shortest Path)
第一个顶点叫源点(Source)
最后一个顶点叫终点(Destination)



2.问题分类

单源最短路径问题：从某固定源点出发，求其到所有其他顶点的最短路径
(有向)无权图
(有向)有权图


