2.无权图的单源最短路算法
按照递增的顺序找出到各个顶点的最短路，与BFS思想很类似！  首先需要定义一个数组dist,dist[W]存储S到W的最短距离，S为起点，dist[S]=0，dist需要被初始化成一个-1(或无穷)，便于后来的判别是否被访问过。 其次需要定义数组path,path[W]存储S到W的路上经过的某顶点。 dist和path数组都需先被初始化为-1~然后将起点的dist[S]设为0，压入队列开始访问 伪代码：
void Unweighted(Vertex S) {
    Enqueue(S, Q);
    while(!IsEmpty(Q)) {
        V = Dequeue(Q);
        for (V的每个邻接点W)
            if(dist[W] == -1) {
                dist[W] = dist[V]+1;
                path[W] = V;
                Enqueue(W, Q);
            }
    }
}

